["TX"] = "{h2:r}Physical Description{/h2}\n\n{col:ffffff}Hylden is a delicate slip of a man, tall and elegant, with little in the way of muscle or fat on his undead figure. His physique is unmarred by scars or rot, leaving him often seen as a beautiful thing - a visage of life painted across the hollow shell of death.\n\nHis hair hangs down close to his hips, violet in color. In life it was a deep, rich brown, but the use of shadow has stained it with the color of his magic. Past use of the void left the soft and unbroken strands with stars strewn through them, the touch of the void extending throughout it just as a poison such as cyanide may grow through locks of hair.{/col}\n\n{h2:c}{link*https://imgur.com/a/hylden-levanthorpe-8efVE0L*ART}{/h2}",
