["HI"] = {
["TX"] = "Honestly, how I got to where I am is somewhat even beyond me. I found myself flung through time, during the Alliance-Horde War in Pandaria. An event I was part of, but also wasn't part of - at least not as I am now. I remember being a Druid, exploring and adventuring here. Fighting alongside the Alliance, eventually joining forces with Vol'jin and those loyal to him to oppose Garrosh. But those events haven't happened, yet, or they have back then, but not yet as of now?\n\nThings have gotten a bit wibbly-wobbly, timey-wimey, and I'm here alongside the - uh, \"good\" Infinite Dragons to research these events and make sure the timeline isn't changed.\n\nSomething tells me that I might be experiencing these events as an variant of myself, from a different timeline.\nAnd I sense that things are only going to get weirder from here on out.",
