["TE"] = 1,
["T1"] = {
["TX"] = "{img:Interface\\QuestionFrame\\answer-RogueCombat:256:128}\n{h1:c}Aleras\"The Shadow's Vegenance\" Leafstar:{/h1}\n\n{p:c}Joining the Military during Prince Arthas Menethil (The Lich King)'s Reign of terror while he travelled through Northrend. Aleras was sent on a special Mission with a Squad of Shadowblades to gather information in Icecrown Citadel, which ended in terrible Failure as his team had been given False information and a trap had been set. Aleras attempted to sacrifice himself to buy time for his team mates to escape but were surrounded by Ebon Blade Death Knights. \n\nAleras suffered torture after Torture by Arthas's Death Knights, including watching his friends be slaughtered right in front of his eyes. The Death Knight that tortured him had given him the famous Scar that all see before him now. \n\nThanks to the Help of a Quel'dorei woman (Lady Silanrea), after managing to use his Shadow Tricks to escape,Aleras managed to get back to the Alliance and recuperate and was sent back into service. Aleras  came to Stormwind City to find a new meaning to his life after 14 years of Military Service.\n\nAfter a brief relationship and marriage with a female ren'dorei, Aleras and her divorced after the birth of their son Ly'gos Leafstar. Aleras decided to leave Winterspring and come back to Stormwind after leaving for awhile,  where he now raises his son alone.. {/p}\n\n{h1:c}Personality of Aleras:{/h1}\n{p:c}Aleras is a quiet, caring, sensitive and fearless Kaldorei Male. He is very genuine Elf. Has issues of Self Esteem and Self Worth. He will do anything when he sees his friends are depressed or down to cheer them up no matter what. He will also sacrifice himself no matter the cost when those he cares about are in trouble. {/p}\n{img:Interface\\QuestionFrame\\answer-RogueSubtlety:256:128}\n{h2:c}Arsenal:{/h2}\n{p:c}2 Standard Dueling Swords\n2 Ethereal Blades (Given to him by his Ex Girlfriend Songerlinn)\nSeveral Smoke Grenades\nKul Tiran Revolver (Grip made with the Barkof Teldrassil)\nRevolver made with an Ivory Handle (Given to him by Xavion Dawnstar for his Birthday)\nA set of Throwing Knives (6 inch Blades)\nGrapplehook Gun{/p}\n{img:Interface\\ARCHEOLOGY\\ArchRare-HighborneSoulMirror:512:256}\n{h2:c}Abilities/Spells:{/h2}\n{p:c}School of Magic: Shadow/Void (Void School of Magic)\nMagic Weakness: Holy/Light Magic\n\nCan Do Most of all Rogue Abilities (Outlaw ones) and can Dispell/Break Curse Magic.\n\nShadow Shield: Wraps Shadow Magic around a Person to protect them from most damage from Spells, can not stop Physical weapons though. \n\nShadow Orbs: A Voltatile Shadow Magic spell that Aleras uses to Stun and break a Target's armor with. Usually will be used also as an Interrupt/Knock back. (Can do a Big Single Orb or 4 Small ones (Verticle halo).\n\nWeapon Spell: The Shadowblade: A One handed type Sword made of pure Shadow Magic, used to attack his enemies with if somehow he gets disarmed. \n\nShadow Chains: Aleras creates a group of up to 4 Shadow Like Chains (Tendrils)to bind his target from attacking. \n\nShadow Orb of Healing: Aleras's Special Shadow Mending Skill that helps heal a target of most of their wounds by creating an Orb of pure Shadow Magic in his hands or above him. \n\nShadow Lances: An offensive Spell that Aleras can Create up to 3 Shadow Lances (Shadow Bolts in Spear like shapes){/p}\n",
},
},
